package com.org.basicPrograms;

public class FnWithParamNoRet {
	public static void WithParamNoRet(String Firstname,String lastname) {
		System.out.println("This is the function With Parameter and Without Return type: ");
		System.out.println(Firstname+" "+lastname);
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		WithParamNoRet("Damon","Salvatore");
	}

}
